(window.webpackJsonp=window.webpackJsonp||[]).push([[597],{953:function(n,h,t){"use strict";t.r(h);var i=t(44),g=Object(i.a)({},(function(){var n=this,h=n.$createElement,t=n._self._c||h;return t("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[t("h1",{attrs:{id:"chuong-1514-chien-tu-xuat-quan-ha"}},[t("a",{staticClass:"header-anchor",attrs:{href:"#chuong-1514-chien-tu-xuat-quan-ha"}},[n._v("#")]),n._v(" Chương 1514: Chiến tử xuất quan (hạ)")]),n._v(" "),t("hr"),n._v(" "),t("p",[n._v("Chương 1514: Chiến tử xuất quan (hạ)"),t("br"),t("br"),n._v("“Chiến tử lập tức liền muốn xuất quan, chuyện này làm sao bẩm báo, các ngươi đều nghĩ kỹ?”"),t("br"),t("br"),n._v("Một cái lão giả phá vỡ bốn phía trầm tĩnh."),t("br"),t("br"),n._v("“Như thực chất báo lên là được, cái này có gì có thể xoắn xuýt?”"),t("br"),t("br"),n._v("Một người mặc khôi giáp người trung niên khoát tay áo, trong giọng nói mang theo thiết huyết mùi vị."),t("br"),t("br"),n._v("“Như thực chất báo lên? Ngươi cũng không phải không biết chiến tử tính tình, lúc trước thông qua khảo hạch, bản thân bị trọng thương, cố nén hôn mê, ban bố đầu thứ nhất chiến tử lệnh, chính là muốn cầu tất cả chiến sư đối với hắn vị lão sư này, cung kính lễ độ, không được vượt qua... Hiện tại gây ra động tĩnh lớn như vậy, nói rõ sự thật, dùng hắn đối vị này tôn trọng mức độ, ngươi cảm thấy sẽ tuỳ tiện bỏ qua?”"),t("br"),t("br"),n._v("Lão giả nhíu nhíu mày: “Một khi náo đem lên, ta sợ thiên hạ đều sẽ đại loạn!”"),t("br"),t("br"),n._v("“Thánh tử điện thuộc về Danh Sư đường, sẽ không xảy ra chuyện, không phải là Trương gia cùng Băng Nguyên cung ư? Bọn họ đại biểu được thiên hạ? Lại nói, ta Chiến Sư đường chiến tử làm việc, cần cùng bọn hắn giải thích? Những người này, bất quá là sinh hoạt tại yên vui bên trong sâu mọt thôi! Không phải chúng ta Chiến Sư đường tắm máu chém giết, có thể hưởng thụ bây giờ thịnh thế? Hưởng thụ dạng này thái bình?”"),t("br"),t("br"),n._v("Thiết giáp người trung niên hừ lạnh."),t("br"),t("br"),n._v("“Mông trưởng lão nói không sai, ta Chiến Sư đường làm việc, không cần tốn nhiều miệng lưỡi, thực lực quyết định cao thấp, năm đó vu hồn sư công hội, vô số Vô Hồn Kim Nhân, cường giả vô số, không giống tuỳ tiện hủy diệt? Danh Sư đường chính là quá chiều theo, cho bọn hắn quá nhiều mặt mũi, mới để cho hắn, có can đảm hỏi tới danh sư trách nhiệm... Đổi thành ta, ban bố cái gì mệnh lệnh, chính là cái gì mệnh lệnh, dám không theo, diệt đi chính là!”"),t("br"),t("br"),n._v("Lại một vị trung niên bàn tay lớn vẫy một cái."),t("br"),t("br"),n._v("“Danh sư, là sư, không phải giặc cướp, càng không phải là lưu manh, Danh Sư đường sở dĩ sừng sững vạn năm không ngã, dựa vào là lấy đức phục người, mà không phải võ lực! Thật muốn làm như vậy, làm sao còn có thể làm cho người tin phục?”"),t("br"),t("br"),n._v("Lão giả lắc đầu."),t("br"),t("br"),n._v("“Tin phục? Ngươi cảm thấy bây giờ còn có để bọn hắn tin phục cần thiết? Hiện tại người, sinh hoạt tại yên vui bên trong, sớm đã mất đi cảm giác nguy cơ, mất đi tan trong trong huyết mạch thiết huyết, quên đi năm đó, Dị Linh tộc nhân thống trị bên dưới, người không bằng chó lịch sử. Bọn hắn giờ phút này, sẽ chỉ nhìn chằm chằm danh sư, khắp nơi tìm kiếm bọn họ đức hạnh bên trong vấn đề, một chút chuyện nhỏ, liền tùy ý lên men, hận không thể vô tận phóng đại. Danh Sư đường, một khi xử lý không hợp ý, liền sẽ mang theo ‘Sư sư tương vệ’ tên tuổi, thông báo thiên hạ...”"),t("br"),t("br"),n._v("Cách đó không xa lại một người trung niên cười lạnh: “Trương sư chuyện này, chính là như vậy. Sự tình vốn không lớn, nhưng mà là danh sư làm, một khi không xử lý, liền sẽ gặp phải vô số người nghi vấn, sư phong sư đức các loại đủ loại tin đồn... Thế nhưng là thật muốn xử lý, có thể xứng đáng, danh sư vì nhân tộc làm cống hiến? Không nói cái khác, vị này Trương sư, nhờ vào sức một người, tiêu diệt một cái Dị Linh hoàng thất chi nhánh, đáng giá được kính nể!”"),t("br"),t("br"),n._v("Thứ dân không biết gì, bọn họ sẽ không để ý, ngươi làm bao nhiêu cống hiến, bỏ ra bao nhiêu tâm huyết, chỉ thấy ngươi phạm vào cái gì sai, hơn nữa đem vô tận phóng đại."),t("br"),t("br"),n._v("Dùng vị này Trương sư làm thí dụ, căn cứ bọn họ lấy được tin tức, tuy là tại tam đại thế lực náo động đến động tĩnh rất lớn, trên thực tế chỉ là hủy hoại một chút kiến trúc cùng trận pháp, tổn thương một số người, đến bây giờ không có người nào bởi vậy tử vong."),t("br"),t("br"),n._v("Có thể... Tin tức truyền đi liền không đồng dạng, người người đều cảm thấy là một vị bát tinh danh sư, dựa dẫm năng lực của mình, tùy ý làm bậy, tùy ý phá hư."),t("br"),t("br"),n._v("Danh Sư đường không cho tại nghiêm trị, sẽ nội bộ lục đục, công tín lực trở nên có cũng được mà không có cũng không sao."),t("br"),t("br"),n._v("“Ta cũng biết những này, nhưng bây giờ Danh Sư đường xử quyết đã xuống, làm sao quyết định, là Danh Sư đường sự tình, cùng chúng ta không quan hệ, chúng ta chỉ cần cân nhắc, làm sao đem chuyện này, hướng chiến tử báo cáo!”"),t("br"),t("br"),n._v("Đánh gãy đối phương, lão giả nói."),t("br"),t("br"),n._v("Loại sự tình này, hắn cũng biết, có thể thì có biện pháp gì?"),t("br"),t("br"),n._v("Danh Sư đường, bị Khổng sư sáng tạo ra mục đích, chính là bảo hộ nhân tộc, dù là không hiểu, cũng muốn đi làm, không thể trơ mắt nhìn lấy sinh linh đồ thán."),t("br"),t("br"),n._v("Đây là trách nhiệm cùng chịu trách nhiệm, không cách nào trốn tránh."),t("br"),t("br"),n._v("Đám người lặng im."),t("br"),t("br"),n._v("Chiến tử đối với hắn vị ân sư này tình cảm, ở chung trong khoảng thời gian này, tất cả đều biết, một khi nghe được bị toàn bộ Danh Sư đường truy nã, nhất định trực tiếp bùng nổ."),t("br"),t("br"),n._v("Đến lúc đó, sẽ gây ra loại nào động tĩnh, ai cũng khó mà đoán trước."),t("br"),t("br"),n._v("Chiến Sư đường thật vất vả xuất hiện một vị chân chính chiến tử, không phải nguyện ý như vậy xuất hiện biến cố."),t("br"),t("br"),n._v("“Trình trưởng lão, ngươi có phải hay không đã nghĩ ra biện pháp gì?”"),t("br"),t("br"),n._v("Một vị trung niên nhịn không được nhìn về phía nói chuyện vị lão giả này."),t("br"),t("br"),n._v("Đám người đồng loạt nhìn qua."),t("br"),t("br"),n._v("“Ta cũng không có phương pháp, hiện tại ý nghĩ là, nói khẳng định nói là, bởi vì tin tức phô thiên cái địa đều là, giấu diếm không được, cùng hắn cố ý che giấu, còn không bằng trước thời hạn báo cáo!”"),t("br"),t("br"),n._v("Lão giả Trình trưởng lão chậm rãi nói."),t("br"),n._v(" Danh sư lệnh truy nã, thông báo thiên hạ, tuy là bế quan không biết rõ tình hình, nhưng chỉ cần hơi hỏi thăm, liền sẽ biết, cùng hắn đến lúc đó chiến tử tự mình biết hiểu, chất vấn bọn họ, còn không bằng trước thời hạn báo cho, chí ít quyền chủ động nắm giữ ở trong tay chính mình, có thể không bị động như vậy."),t("br"),t("br"),n._v("Đám người biết điểm ấy, đồng thời gật đầu."),t("br"),t("br"),n._v("Nếu không phải là bởi vì biết cái này, cũng không trở thành cả đám đều có chút đau đầu."),t("br"),t("br"),n._v("“Chúng ta lúc nói, có thể chủ yếu giải thích Trương sư gây ra mâu thuẫn, tội lỗi, còn trừng phạt cùng truy nã, liền hời hợt một câu mang qua, chắc hẳn, chiến tử có thể đánh giá ra nặng nhẹ, không đến mức lỗ mãng!”"),t("br"),t("br"),n._v("Dừng lại một chút, Trình trưởng lão nói."),t("br"),t("br"),n._v("Không nói không thể, chỉ có thể đổi lại phương thức."),t("br"),t("br"),n._v("“Được!”"),t("br"),t("br"),n._v("Đám người lên tiếng."),t("br"),t("br"),n._v("Mới vừa thảo luận xong, còn chưa kịp nói tỉ mỉ, liền nghe đến cửa phòng “Kẹt kẹt” một tiếng, từ từ mở ra, một cái cầm trong tay trường thương thiếu niên, chậm rãi đi ra."),t("br"),t("br"),n._v("Tuổi không lớn lắm, nhưng cho người ta một loại, sắc bén đâm thủng bầu trời cảm giác, trong cơ thể từng đạo chân khí, sôi trào xoay tròn, tựa như lúc nào cũng sẽ nổ tung, để cho người ta khó mà ngăn cản."),t("br"),t("br"),n._v("“Cung nghênh chiến tử xuất quan!”"),t("br"),t("br"),n._v("Đám người ôm quyền."),t("br"),t("br"),n._v("“Ừm!”"),t("br"),t("br"),n._v("Khoát tay áo, thiếu niên ngừng lại, mặc dù không có bất kỳ động tác gì, nhưng kèm theo một cỗ khí tức, để cho người ta không dám nói chuyện lớn tiếng."),t("br"),t("br"),n._v("“Nhiều trưởng lão như vậy đồng thời tới, xảy ra chuyện gì?”"),t("br"),t("br"),n._v("Nhìn quanh một vòng, thiếu niên lông mày giương lên."),t("br"),t("br"),n._v("“Bẩm báo chiến tử, là như vậy, ngươi để chúng ta quan tâm kỹ càng vị kia Trương Huyền Trương sư, nhận được hồi báo... Tối hôm qua, đại náo Trương gia, phá hủy kiến trúc vô số, làm bị thương trưởng lão mười mấy tên; Về sau, đi Thánh tử điện, đem quyền điện chủ Chiêm sư đám người đả thương... Càng là chạy đến Băng Nguyên cung, phá hủy cơ sở, bắt đi hắn thiếu cung chủ...”"),t("br"),t("br"),n._v("Vội vàng tiến lên, Trình trưởng lão đem tổ chức tốt ngôn ngữ nói ra."),t("br"),t("br"),n._v("Hắn nói, đều là Trương Huyền làm sự tình, để chiến tử trong lòng có số lượng, đừng quá mức lo lắng."),t("br"),t("br"),n._v("Bất quá, lời còn chưa dứt, liền nghe đến trước mắt chiến tử, cười lạnh một tiếng ngắt lời hắn: “Những lời này, là chính ngươi nói, vẫn là Danh Sư đường thông báo?”"),t("br"),t("br"),n._v("“Cái này... Là ta được đến tin tức!” Trình trưởng lão vội nói."),t("br"),t("br"),n._v("“Ngươi lấy được tin tức như vậy không thật?”"),t("br"),t("br"),n._v("Bỗng nhiên xoay người, thiếu niên ánh mắt mang theo băng lãnh chi ý: “Bắt đi Băng Nguyên cung thiếu cung chủ, ngươi cũng đã biết, vị này thiếu cung chủ, là người phương nào? Liền như thế nói?”"),t("br"),t("br"),n._v("“Thuộc hạ... Không biết!”"),t("br"),t("br"),n._v("Trong lòng “Lộp bộp!” Một chút, Trình trưởng lão lắc đầu."),t("br"),t("br"),n._v("“Lão sư chỉ cần thông báo một tiếng, vị này thiếu cung chủ sẽ lập tức bỏ qua thân phận, đi theo rời đi, còn cần đến ‘Cướp’ ? Nói đùa cái gì!”"),t("br"),t("br"),n._v("Thiếu niên xua tay."),t("br"),t("br"),n._v("“Cái này... Chiến tử làm sao biết được?” Trình trưởng lão nhịn không được nhìn qua."),t("br"),t("br"),n._v("“Bởi vì Băng Nguyên cung vị này thiếu cung chủ...”"),t("br"),t("br"),n._v("Một tay cầm thương, một tay chắp sau lưng, thiếu niên đầu nâng lên: “Là sư tỷ ta!”"),t("br"),t("br"),n._v("P/S: Thế lực có não nhất truyện: V"),t("br"),t("br"),n._v("Người đăng: ThấtDạ"),t("br"),t("br"),t("br"),t("br")]),n._v(" "),t("hr"),n._v(" "),t("p",[t("a",{attrs:{href:"./chap-1522"}},[n._v("Chương trước")]),n._v("  |  "),t("a",{attrs:{href:"./chap-1524"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=g.exports}}]);